  \"2014-08-28T20:21:34.350891\",\n\t\"name\": \"an-imaging-polar-nephelometer\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This invention relates to measuring the
  light that is scattered from particulates (aerosols) in a gas or liquid. The sample
  typically flows into the instrument and the particulates are measured in-situ. The
  intensity of the scattered light is measured at many different angles, which determines
  both the amount of particulates in the sample, and detailed information about the
  particles such as average size, shape and composition. The measurement can be applied
  to climate and air pollution research, and clean room monitoring.\",\n\t\"license_title\":
